import Signup from "../signup/Signup"
export default class ToggalLoginAndSignup extends Component {
    render() {
        return (
            <BrowserRouter>
            <Route path="/login" component={Login}/>
            <Route path="/" component={Signup}/>

            </BrowserRouter>
        )
    }
}
